 return(

 <Card 
       key={val.id}
       title={val.title}
       img_src={val.img_src}
       info={val.info}
       photo_src={val.photo_src}
  />
 );    
}

ReactDOM.render( 
<>
  <h1 className="heading">Dogs and cars</h1>
    {Ncards.map(am)}
</>
